<script>
        let allGpxLayer = null;

        window.addEventListener("DOMContentLoaded", function () {
            function toggleAllGpxLayer() {
                const map = map_87b14301c51899186b447e99c0da6a42;
                const zoom = map.getZoom();

                if (zoom >= 10 && !allGpxLayer) {
                    fetch('../gpx/simplified_trails_colored.geojson')
                        .then(res => res.json())
                        .then(data => {
                            const groupLayers = [];

                            L.geoJSON(data, {
                                style: function(feature) {
                                    return {
                                        color: feature.properties.color || 'gray',
                                        weight: 2,
                                        opacity: 0.7
                                    };
                                },
                                onEachFeature: function (feature, layer) {
                                    if (feature.geometry.type === "LineString") {
                                        const coords = feature.geometry.coordinates;

                                        // Tooltip z nazwą
                                        if (feature.properties && feature.properties.name) {
                                            layer.bindTooltip(feature.properties.name, { sticky: true });
                                        }

                                        // Hover – podświetlenie na różowo
                                        layer.on({
                                            mouseover: function () {
                                                layer.setStyle({ weight: 5, color: '#ff69b4' });
                                            },
                                            mouseout: function () {
                                                layer.setStyle({
                                                    weight: 2,
                                                    color: feature.properties.color || 'gray'
                                                });
                                            }
                                        });

                                        // Start i koniec trasy
                                        const startMarker = L.circleMarker([coords[0][1], coords[0][0]], {
                                            radius: 3,
                                            color: "green",
                                            fillColor: "green",
                                            fillOpacity: 1
                                        });
                                        const endMarker = L.circleMarker([coords[coords.length - 1][1], coords[coords.length - 1][0]], {
                                            radius: 3,
                                            color: "blue",
                                            fillColor: "blue",
                                            fillOpacity: 1
                                        });

                                        const group = L.layerGroup([layer, startMarker, endMarker]);
                                        groupLayers.push(group);
                                    }
                                }
                            });

                            allGpxLayer = L.layerGroup(groupLayers);
                            allGpxLayer.addTo(map);
                        });
                }

                if (zoom < 10 && allGpxLayer) {
                    map.removeLayer(allGpxLayer);
                    allGpxLayer = null;
                }
            }

            const map = map_87b14301c51899186b447e99c0da6a42;
            map.on('zoomend', toggleAllGpxLayer);
            toggleAllGpxLayer();
        });
    </script>
